import { useState } from "react";

const defaultFormFields = {
  displayName: "",
  email: "",
  password: "",
  confirmPassword: "",
};

const SignUpForm = () => {
  const [formFields, setFormFields] = useState(defaultFormFields);
  const { displayName, email, password, confirmPassword } = formFields;

  const handleChange = (event) => {
    const {name} = event;
  };

  return (
    <div>
      <h1>Sign up with your email and password</h1>
      <form action="" onSubmit={() => {}}>
        <label htmlFor="">Display Name</label>
        <input required type="text" onChange={handleChange} name="displayName" value={displayName} />

        <label htmlFor="">Email</label>
        <input required type="email" onChange={handleChange} name="email" value={displayName}  />

        <label htmlFor="">Password</label>
        <input required type="password" onChange={handleChange} name="password" value={displayName}  />

        <label htmlFor="">Confirm Password</label>
        <input required type="password" onChange={handleChange} name="confirmPassword" value={displayName}  />
        <button type="submit">Sign Up</button>
      </form>
    </div>
  );
};

export default SignUpForm;
